"""2. Use the following code in your application to request a model response"""

from google import genai
from google.genai import types
import base64
import os

def generate():
  client = genai.Client(
      vertexai=True,
      api_key=os.environ.get("GOOGLE_CLOUD_API_KEY"),
  )

  msg1_text1 = types.Part.from_text(text="""Analyze the given image and estimate a concise, descriptive name for it. Then create a list of meaningful, specific tags that would make this image easy to search for in an icon library.Requirements:
Return the output strictly in JSON format.
The JSON must have two keys:
\"name\": a short descriptive string (e.g., \"home\", \"search\", \"settings\").\"tags\": a list of specific keywords that relate to the image’s content.Avoid generic words such as \"icon\", \"symbol\", \"graphic\", or \"image\".
Focus on concrete objects, actions, concepts, or attributes present in the image.Example output:
{
\"name\": \"shopping-cart\",
\"tags\": [\"cart\", \"shopping\", \"ecommerce\", \"basket\", \"purchase\"]
}""")
  msg1_image1 = types.Part.from_bytes(
      data=base64.b64decode(""""""),
      mime_type="image/png",
  )

  model = "gemini-2.5-flash-lite"
  contents = [
    types.Content(
      role="user",
      parts=[
        msg1_text1,
        msg1_image1
      ]
    ),
  ]

  generate_content_config = types.GenerateContentConfig(
    temperature = 1,
    top_p = 0.95,
    max_output_tokens = 65535,
    safety_settings = [types.SafetySetting(
      category="HARM_CATEGORY_HATE_SPEECH",
      threshold="OFF"
    ),types.SafetySetting(
      category="HARM_CATEGORY_DANGEROUS_CONTENT",
      threshold="OFF"
    ),types.SafetySetting(
      category="HARM_CATEGORY_SEXUALLY_EXPLICIT",
      threshold="OFF"
    ),types.SafetySetting(
      category="HARM_CATEGORY_HARASSMENT",
      threshold="OFF"
    )],
    thinking_config=types.ThinkingConfig(
      thinking_budget=0,
    ),
  )

  for chunk in client.models.generate_content_stream(
    model = model,
    contents = contents,
    config = generate_content_config,
    ):
    print(chunk.text, end="")

generate()